    false,nt"url": null,nt"notes": "The DSWM WCS Areas polygon feature class
    was created by the Miami-Dade Enterprise Technology Department with data provided
    by the Department of Solid Waste Management (DSWM). It defines the boundaries of
    the seven areas in which the DSWM service area is divided for the purpose of Garbage
    Pick. The boundaries of the WCS Areas are determined by the boundaries of the DSWM
    Garbage pickup routes. The WCS areas are identified by the numbers from 1 to 7.
    The WCS areas ID grow from north to south being 1 to the north of Miami-Dade County
    and WCS area 7 the last to the south. The WCS Areas cover the area of Unincorporated
    Miami-Dade County and of the municipalities served by DSWM.",nt"license_title":
